import React, { Component } from 'react';
import axios from 'axios';
import './loginn.css';



class Registro extends Component {
    state = {
        email: '',
        password: '',
        name: '',
        userType: 'artista', // Valor padrão para artista
        message: '',
    };

    handleChange = (e) => {
        this.setState({ [e.target.name]: e.target.value });
    };

    handleRegister = async () => {
        const { email, password, name, userType, document, telefone } = this.state;
        var data = {};
        try {
            let response;
            if (userType === 'artista') {
               // data = { "user": { "name": "teste", "email": "teste@teste18.com", "password": "teste", "pic": "teste", "telefone": "43434" } };
                data = { "user": { email, password, name, "pic": "0", "telefone": telefone } };

                response = await axios.post(process.env.REACT_APP_API + '/user/RegisterArtista', data);
            } else {
               // data = { "document": "43802329805", "user": { "name": "teste", "email": "teste@teste18.com", "password": "teste", "pic": "teste", "telefone": "43434" } };
                data = { "document": document, "user": { email, password, name, "pic": "0", "telefone": telefone } };
                console.log(data);
                response = await axios.post(process.env.REACT_APP_API + '/user/RegisterCliente', data);
            }

            const result = response.data;
            if (result.success) {
                this.setState({ message: result.sucesso });
            } else if (result.error) {
                this.setState({ message: result.erro });
            }
        } catch (error) {
            console.error(error);
        }
    };

    render() {
        const { email, password, name, userType, telefone, document } = this.state;

        return (
            <div class="container">
                <div class="form-image">
                    <div class="texto">
                        <h1>Bem Vindo!</h1>
                        <br/>
                            <p>Realize o Cadastro para criar sua conta.</p>
                    </div>
                </div>
                <div class="form">
                    <div class="form-header">
                        <div class="title">
                            <h1>Cadastre-se</h1>
                        </div>
                    </div>

                    <div class="input-group">
                        <div class="input-box">
                            <label for="name">Nome</label>
                            <input
                                id="name"
                                type="text"
                                name="name"
                                placeholder="Digite seu nome"
                                value={name}
                                onChange={this.handleChange}
                                required
                            >
                            </input>
                        </div>

                        <div class="input-box">
                            <label for="email">Email</label>
                            <input
                                id="email"
                                type="email"
                                name="email"
                                placeholder="Digite seu email"
                                value={email}
                                onChange={this.handleChange}
                                required
                            >
                            </input>
                        </div>

                        <div class="input-box">
                            <label for="password">Senha</label>
                            <input
                                id="password"
                                type="password"
                                name="password"
                                placeholder="Digite sua senha"
                                value={password}
                                onChange={this.handleChange}
                                required
                            >
                            </input>
                        </div>

                        <div class="input-box">
                            <label for="telefone">Telefone</label>
                            <input
                                id="telefone"
                                type="number"
                                name="telefone"
                                placeholder="(xx) xxxx-xxxx"
                                value={telefone}
                                onChange={this.handleChange}
                                required
                            >
                            </input>
                        </div>

                        <div class="input-box">
                            <label for="userType">Tipo de Usuário</label>
                            <select
                                id="userType"
                                name="userType"
                                required
                                value={userType}
                                onChange={this.handleChange}
                            >
                                <option value="artista">Artista</option>
                                <option value="cliente">Cliente</option>
                            </select>
                        </div>

                        {userType === 'cliente' && (
                            <div class="input-box">
                                <label for="document">Documento</label>
                                <input
                                    id="document"
                                    type="text"
                                    name="document"
                                    placeholder="Digite seu documento"
                                    value={document}
                                    onChange={this.handleChange}
                                    required
                                >
                                </input>
                            </div>
                            )}
                        </div>
                        <div class="continue-button">
                        <button onClick={this.handleRegister}><a href="#">Registrar</a></button>
                        </div>
                </div>
            </div>

        );
    }
}

export default Registro;
